import  {useState} from 'react'
import {Button} from 'antd-mobile'
import Head from './../components/head/index'
import  './../style/index.scss'

const Index = () => {
  const [state, setState] = useState({
    name: 12
  })
  return (
    <div className='page-box'>
      <Head></Head>
      <div>{state.name}</div>
    </div>
  )
}
export default Index
